import { blue_bg } from "../../assets";
import styles from "./LoginContainer.module.css";

const LoginContainer = () => {
  return (
    <>
      <div className={styles.background}>
        <img src={blue_bg} alt="" />
      </div>
    </>
  );
};

export default LoginContainer;
